import React from 'react';
import DoggoList from './DoggoList';

function DoggoApp () {
  return (
    <div className="container">

      <DoggoList 
        doggoName="Shiba Inu aka Doge" 
        doggoAge="5" 
        doggoId="J...546L" 
        doggoDescription="Yes shiba inu is one of the cutest doggo in the world"
      />
      <DoggoList 
        doggoName="Husky aka moonmoon" 
        doggoAge="3" 
        doggoId="J...324P" 
        doggoDescription="Moonmoon is also famous on the internet and they like to howl"
      />

    </div>
  );
}

export default DoggoApp;
